    [],nt"revision_timestamp": "2016-01-16T09:14:43.831538",nt"name": "guam-commercial-fisheries-biosampling-cfbs",nt"isopen":
    false,nt"url": null,nt"notes": "The Guam Commercial Fisheries Biosampling
    program, which collects length and weight frequency data for whole commercial catches,
    and samples 4-8 species for in-depth life history studies as well as DNA (finclips)
    and voucher specimens for the Fish Barcode of life, began in August, 2009. Guam
    has had very little market-based commercial size sampling over the years. However,
    the new bio-sampling program has been quite successful and robust, due to the cooperation
    and participation of the Guam Fishermen's Cooperative Association.  Census sampling
    of a high percentage of the non-pelagic fishing trips has been conducted since late
    2009. As with the other CFBS programs, catch, effort, and fishing location are recorded
    for a majority of the fishing trips and every fish or invertebrate harvested is
    identified, measured and weighed for each fishing method encountered with the exception
    of trolling.  Life history samples are also collected and processed for a number
    of reef fish species. These data are considered confidential. Continuation is subject
    to availability of funds.",nt"license_title": null,nt"extras": [{ntt"key":
